import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Typography, Box } from "@material-ui/core";
import Navbar from "./Navbar";
import WorkExperienceEntry from "./WorkExperienceEntry";

const useStyles = makeStyles((theme) => ({
  mainContainer: {
    background: theme.palette.primary.dark,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  contentArea: {
    width: "95%",
    [theme.breakpoints.up("lg")]: {
      // larger screens 80% width
      width: "80%",
    },
  },
  timeline: {
    position: "relative",
    padding: "1rem",
    margin: "0 auto",
    "&:before": {
      content: "''", // need double quotes otherwise wont' work?
      position: "absolute",
      height: "100%",
      border: `1px white solid`,
      right: "40px",
      top: 0,
    },
    "&:after": {
      content: "''", // need double quotes otherwise wont' work?
      display: "table",
      clear: "both",
    },
    [theme.breakpoints.up("md")]: {
      // medium screens centered. 960 px
      padding: "0rem",
      "&:before": {
        left: "calc(50% - 1px)",
        right: "auto",
      },
    },
  },
  timelineYear: {
    textAlign: "center",
    maxWidth: "6.5rem",
    margin: "0 2rem 0 auto",
    fontSize: "1.5rem",
    background: theme.palette.accent1.main,
    // color: "white",
    lineheight: 1,
    padding: "0.5rem 1rem", // 0.5rem 0 1rem
    borderRadius: "1.2rem",
    "&:before": {
      display: "none",
    },
    [theme.breakpoints.up("md")]: {
      textAlign: "center",
      margin: "0 auto",
      "&:nth-of-type(2n)": {
        float: "none",
        margin: "0 auto",
      },
      "&:nth-of-type(2n):before": {
        display: "none",
      },
    },
  },
  heading: {
    // color: "tomato",
    padding: "3rem 0",
    textTransform: "lowercase",
  },
}));

const Timeline = () => {
  const classes = useStyles();
  return (
    <>
      {/* <Navbar /> */}
      <Box className={classes.mainContainer} component="header">
        <Box className={classes.contentArea}>
          <Typography className={classes.heading} variant="h4" align="center">
            software experience
          </Typography>
          <Box className={classes.timeline} component="div">
            <Typography className={classes.timelineYear} variant="h2">
              2013
            </Typography>

            <WorkExperienceEntry />
            <WorkExperienceEntry />
            <WorkExperienceEntry />
            <WorkExperienceEntry />
            <WorkExperienceEntry />
          </Box>
        </Box>
      </Box>
    </>
  );
};

export default Timeline;
